}

ReactDOM.render(
  <>
    <h1 className="heading_style">List of Top 10 Netflix Series in All Time</h1>

    <Card
      
      
      imgsrc={Sdata[0].imgsrc}
      title={Sdata[0].title}
      sname={Sdata[0].sname}
      links={Sdata[0].links} />

    Sdata.map(ncard)
  </>
  
  ,
  document.getElementById('root')
);
